let _markdown = "\n\nPrivacy Policy [#privacy-policy]\n\n**Last updated:** February 2026\n\nLinkDen is an open-source, self-hosted application. This privacy policy covers the **documentation site** hosted at `mrdemonwolf.github.io/linkden`. If you self-host LinkDen, your own privacy policy applies to your instance.\n\nWhat We Collect [#what-we-collect]\n\nDocumentation Site [#documentation-site]\n\nThis documentation site is a static site hosted on **GitHub Pages**. We do not:\n\n* Use cookies or tracking scripts\n* Collect personal information\n* Use analytics services\n* Store any visitor data\n\nGitHub Pages may collect basic server logs (IP addresses, user-agent strings) as part of their standard hosting. See [GitHub's Privacy Statement](https://docs.github.com/en/site-policy/privacy-policies/github-general-privacy-statement) for details.\n\nSelf-Hosted Instances [#self-hosted-instances]\n\nWhen you deploy your own LinkDen instance, **you** are the data controller. LinkDen stores the following data in your Cloudflare D1 database:\n\n* **Profile data**  name, bio, profile image URL\n* **Links**  URLs, titles, icons, sort order\n* **Settings**  theme, colors, branding, configuration\n* **Analytics**  page views, link clicks, referrers, country codes (from Cloudflare headers)\n* **Contact form submissions**  name, email, message (if contact form is enabled)\n* **vCard data**  contact information you configure\n\nAll data is stored in **your own** Cloudflare D1 database. LinkDen does not phone home, send telemetry, or share data with third parties.\n\nThird-Party Services [#third-party-services]\n\nSelf-hosted LinkDen instances may optionally integrate with:\n\n* **Clerk**  authentication provider (see [Clerk's Privacy Policy](https://clerk.com/legal/privacy))\n* **Cloudflare**  hosting and CDN (see [Cloudflare's Privacy Policy](https://www.cloudflare.com/privacypolicy/))\n* **Resend**  email delivery for contact form notifications (see [Resend's Privacy Policy](https://resend.com/legal/privacy-policy))\n\nYour Rights [#your-rights]\n\nSince LinkDen is self-hosted, you have complete control over all data. You can export, delete, or modify any data at any time through the admin panel or directly in your D1 database.\n\nContact [#contact]\n\nFor questions about this policy, please [open an issue on GitHub](https://github.com/mrdemonwolf/linkden/issues).\n";
