let _markdown = "\n\nFrequently Asked Questions [#frequently-asked-questions]\n\nGeneral [#general]\n\nWhat is LinkDen? [#what-is-linkden]\n\nLinkDen is a self-hosted, open-source link-in-bio platform. It's a modern alternative to Linktree, built on the Cloudflare stack with a full admin panel and edge performance.\n\nIs LinkDen free? [#is-linkden-free]\n\nYes. LinkDen is MIT licensed and completely free. Cloudflare's free tier covers Workers, D1, and Pages -- so you can deploy at zero cost.\n\nCan I use LinkDen commercially? [#can-i-use-linkden-commercially]\n\nAbsolutely. The MIT license allows unrestricted commercial use. You can remove all LinkDen branding and use it for clients, businesses, or any purpose.\n\nHow is LinkDen different from Linktree? [#how-is-linkden-different-from-linktree]\n\n| Feature        | LinkDen                 | Linktree                      |\n| -------------- | ----------------------- | ----------------------------- |\n| Pricing        | Free (self-hosted)      | Free tier + paid plans        |\n| Data ownership | You own everything      | Linktree owns your data       |\n| Custom domain  | Full support            | Paid plans only               |\n| Whitelabel     | 100% (MIT license)      | Not available                 |\n| Analytics      | Built-in, private       | Built-in, Linktree has access |\n| Customization  | Full code access        | Limited to their editor       |\n| Apple Wallet   | Built-in                | Not available                 |\n| Hosting        | Your Cloudflare account | Linktree's servers            |\n\n***\n\nDeployment [#deployment]\n\nDo I need a Cloudflare account? [#do-i-need-a-cloudflare-account]\n\nYes for the primary deployment path. LinkDen runs on Cloudflare Workers (API) and can deploy the frontend to Cloudflare Pages. However, Docker self-hosting is also supported.\n\nCan I deploy without Cloudflare? [#can-i-deploy-without-cloudflare]\n\nYes. LinkDen includes a Docker setup for self-hosting outside Cloudflare. See the [Docker](/docs/self-hosting/docker) and [Coolify](/docs/self-hosting/coolify) guides.\n\nDoes LinkDen support multiple users? [#does-linkden-support-multiple-users]\n\nLinkDen is designed as a **single-user** platform. One instance = one link page. If you need multiple users, deploy separate instances.\n\nHow does authentication work? [#how-does-authentication-work]\n\nLinkDen uses Better Auth with email/password authentication. During first-time setup, you create an admin account through the setup wizard. No external auth service (Clerk, Auth0, etc.) is needed. See the [authentication guide](/docs/api/authentication).\n\n***\n\nFeatures [#features]\n\nWhat block types are available? [#what-block-types-are-available]\n\nLinkDen supports 5 block types: **Link**, **Header**, **Social Icons**, **Embed** (YouTube, Spotify, SoundCloud, Custom), and **Contact Form**. Each block type has its own configuration options for styling, scheduling, and behavior.\n\nHow many themes are there? [#how-many-themes-are-there]\n\n7 built-in themes, each with both dark and light variants (14 total): Default, Corporate Classic, Corporate Modern, Hacker Terminal, Neon Cyber, Furry Pastel, and Furry Bold. You can also customize colors and add custom CSS.\n\nCan I use my own domain? [#can-i-use-my-own-domain]\n\nYes. See the [custom domain guide](/docs/self-hosting/custom-domain) for DNS configuration instructions.\n\n***\n\nTroubleshooting [#troubleshooting]\n\nThe admin panel shows \"Failed to...\" errors [#the-admin-panel-shows-failed-to-errors]\n\nThis usually means the API server isn't running or isn't reachable. Check:\n\n1. Is the server running? Run `pnpm dev` from the project root to start all apps.\n2. Is `NEXT_PUBLIC_SERVER_URL` set correctly in `.env`? It should be `http://localhost:3000` for local development.\n3. Check the server logs for errors.\n\nI get CORS errors in the browser [#i-get-cors-errors-in-the-browser]\n\nThe `CORS_ORIGIN` environment variable must match your frontend URL exactly. For local development, set it to `http://localhost:3001` in `.env`.\n\nDatabase migrations fail [#database-migrations-fail]\n\nRun `pnpm db:push` from the project root. For a fresh start, you can reset the D1 database in the Cloudflare dashboard.\n\nThe build fails with type errors [#the-build-fails-with-type-errors]\n\nRun `pnpm check-types` to see all type errors across the monorepo. Common causes:\n\n* Missing environment variables\n* Out-of-date dependencies -- run `pnpm install` to refresh\n\nStyles look broken after updating [#styles-look-broken-after-updating]\n\nClear the Next.js cache: `rm -rf apps/web/.next` and restart the dev server.\n";
